private static void copy(InputStream input, File output) throws IOException {
  FileOutputStream os = new FileOutputStream(output);
  try {
    byte buffer[] = new byte[1024];
    int len;
    while ((len = input.read(buffer)) > 0) {
      os.write(buffer, 0, len);
    }
  } finally {
    os.close();
  }
}

